import React from 'react'

const Developer = (props) => {
  return (
      <>
      {/* Information About Creater  */}
      <h1 className='text-secondary text-center my-5 ' style={{
          backgroundColor: "rgba(255, 255, 255, 0.234)",
          display: "block",
        }}>Information About Developer</h1>

    <h3 className="text-secondary mx-4">Name: <span className='text-dark mx-2'> {props.name}</span></h3>
    <h3 className="text-secondary mx-4">Email: <span className='text-dark mx-2'> {props.email}</span></h3>
    <h3 className="text-secondary mx-3">Mobile: <span className='text-dark mx-2'> {props.mobile}</span></h3>

      <section>
      {/* 1 . Built with MERN Developement: */}
         <h3 className="text-secondary">1 . Built with MERN Developement:</h3>
         <p className="mx-5 my-2" style={{fontSize:"20px"}}>I developed <span className="text-primary">
          <b>iNoteBook</b>
        </span> using <span className="text-primary">
          <b>MongoDB , Express JS , React JS, Node JS and Bootstrap  </b>
        </span>. These tools played a crucial role in creating a robust and efficient platform for you to manage your notes effortlessly.</p>


      </section>
    </>
  )
}

export default Developer
